import React, { useState } from "react";
import AppointmentTypeDropdown from "./AppointmentTypeDropdown";

const Booking = () => {
  const [selectedType, setSelectedType] = useState("");

  const handleTypeSelect = (typeId) => {
    console.log("Selected appointment type:", typeId);
    setSelectedType(typeId);
    // Next: fetch available times using selectedType
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Book an Appointment</h1>

      <AppointmentTypeDropdown
        practitionerId="1025345283992592726"
        onSelect={handleTypeSelect}
      />

      {selectedType && (
        <p className="mt-4 text-green-600">
          Selected Appointment Type ID: {selectedType}
        </p>
      )}
    </div>
  );
};

export default Booking;
